import Vue from 'vue'
import VueRouter from 'vue-router'
import App from './App.vue'
import Carga from './views/Carga.vue'
import vuetify from './plugins/vuetify'

Vue.use(VueRouter)



const router = new VueRouter({
  routes:  [
    {
      path: '/',
      name: 'carga',
      component: Carga
    },
    {
      path:'/',
      name:'home',
      component: App
    }
  
  ]
})
  
Vue.config.productionTip = false

new Vue({
  router,
  vuetify,
  render: h => h(App)
}).$mount('#app')
